    DECLARE  id int default  1;
		DECLARE  sjhm varchar(32) default '';
		DECLARE  ids varchar(32) default '';

    while id<2000 DO
        SET sjhm = CONCAT((13000000000+id),'');
				SET ids = CONCAT ((10000+id),'');

				set id=id+1;

    END WHILE; 
 
END
;;
